textOriginal:
adivinhe o país:
- um militar que sofreu faltas disciplinares no exército chegou à
 presidência;
- presidente incentivou o porte de armas em milícias pró-governo;
- presidente é um líder populista que alega conhecer e defender a vontade do povo;
- presidente argumenta que são as instituições e as elites os empecilhos para que eles possam governar;
- presidente atacou a suprema corte e outras instituições;
- presidente militarizou o Estado, com retorno de militares às funções civis do Estado brasileiro;
- presidente atacou, perseguiu e humilhou a imprensa;
- presidente debateu com as estatísticas oficiais;
- presidente constrangeu, quando não demitiu, funcionários públicos por questão ideológicas;
- presidente, assim que eleito, mobilizou uma campanha que defendia o bem (sem próprio governo) sobre o mal (oposição, demais poderes e máquina estatal)
- presidente aumentou o número de ministros do Supremo;
- presidente ignorou a lista tríplice da Procuradoria Geral e colocou um aliado;
- presidente tirou o peso da votação de Reitores das Universidades;
- presidente nomeou militar como comandante da pretroleira estatal;
- presidente aumentou o ensino militar no país;
- presidente mantém comunicação direta com o eleitor por meio de programas, sem entrevistas;

acertou quem disse "Venezuela"
